import React, { Component } from 'react';
import "./Styles/Login.css";

class Login extends Component {
    constructor(){
        super();
        this.state = {username:"" , password:""};
    }

    handleChange()
    {
        this.setState({
                        username: document.querySelector(input[username]).value,
                        passowrd: document.querySelector(input[password]).value,    
                        });
    }

    render() {
        return (
            <div id="Login">
                <div id="LoginForm">
                     <div className="LoginLabel">Username</div>
                     <div className="LoginInput"><input onChange={this.handleChange} name="username" type="text"></input></div>
                     <div className="LoginLabel">Password</div>
                     <div className="LoginInput"><input onChange={this.handleChange} name="password" type="password"></input></div>
                </div>
            </div>
        );
    }

}

export default Login;
